import ExpenseItem from "./ExpenseItem";
import expenses from "./expensesDummyDB";
import "./"

const Expenses = () => {
  const newExpenses = [];
  expenses.forEach((expense) => {
    newExpenses.push(
      <div>
        <ExpenseItem expense={expense} />
      </div>
    );
  });
  return newExpenses;
};
export default Expenses;
